import './Countdown.css';

const Countdown = () => {
  return (
    <div className="countdown">
      <div>LEEZY BOOST 103</div>
      <span>13</span>
      <span>DAYS</span>
      <span>08</span>
      <span>HOURS</span>
      <span>12</span>
      <span>MINS</span>
      <span>05</span>
      <span>SECS</span>
    </div>
  );
};

export default Countdown;
